                    </Typography>
                    <Typography variant="h5" component="div">
                        Trainer looking to offer some training
                    </Typography>
                </CardContent>
                </Box>
                <Box sx={{ mr: 2 }}>
                    <Button color="error">
                        Delete
                    </Button>
                </Box>
            </Box>
        </Card>
    )
}

export default UserPost;
